import React from 'react';
import './styles.css';
import { Link, animateScroll as scroll } from "react-scroll";

export default function Home() {

    const indexImage = require('../../Assets/Images/index-image.jpg');
    const logo = require('../../Assets/Images/logo-in8-dev.svg');

    return (
        <div className="home-container">
            <div className="content">
                <img className="image-index" src={indexImage} alt=""/>
                <img className="logo-index" src={logo} alt=""/>
                <div className="home-title">
                    <div style={{fontSize: 72}}>ESTÁGIO</div> 
                    <div style={{fontSize: 32}}>PROVA DE SELEÇÃO</div>
                </div>
                <div>
                    <nav className="nav" id="navbar">
                        <div className="nav-content">
                        <img
                            src={logo}
                            className="nav-logo"
                            alt="Logo."
                            onClick={this.scrollToTop}
                        />
                        <ul className="nav-items">
                            <li className="nav-item">Section 1</li>
                            <li className="nav-item">Section 2</li>
                            <li className="nav-item">Section 3</li>
                            <li className="nav-item">Section 4</li>
                            <li className="nav-item">Section 5</li>
                        </ul>
                        </div>
                    </nav>
                </div>
            </div>
        </div>
    );
}
